    false,nt"url": null,nt"notes": "This annual narrative report for Rocky
    Mountain Arsenal National Wildlife Refuge summarizes Refuge activities during the
    1993 fiscal year. The report begins with a summary of the weather and habitat conditions
    during the period.nIt contains annual summaries for Task 1, wildlife health and
    management; Task 2, habitat mitigation and enhancement; Task 3, activities coordination;
    Task 4, planning and public participation; and Task 5, engineering and administrative
    support.  Items of interest are provided at the end of the report, as well as detailed
    appendixes on cooperative research units studies, and herd health status of mule
    deer and white-tailed deer.",nt"license_title": "License Not Specified",nt"extras":
